import React, {Component} from 'react';
import './Background.css';

class Background extends Component{
    render(){
        return (
            <div className="background-svg">
                <svg>
                    <path d="M0 0 L150 150 L350 150" fill="transparent" stroke="#333"></path>
                    <circle cx="357" cy="150" r="7" fill="transparent" stroke="#333"></circle>
                </svg>
            </div>
        );
    }
}

export default Background;
